def get_div_yields():
    yields = []

    for stock in SnP500:
        ticker = yahooquery.Ticker(stock)
        #take avg of foward and trailing div yield
        try: 
            dy = (ticker.summary_detail[stock]["dividendYield"] + ticker.summary_detail[stock]["trailingAnnualDividendYield"]) / 2
        except:
            dy = 0.0
        yields.append(dy)
        # print(stock, dy)
        #cant base only off %, consider 5 yr div yeild, income relative to yield, variance of income/div %

    with open("dividendsYield.pkl", "wb") as pkl:
        pickle.dump(yields, pkl)
    
def generate_relative_growth(num_years=None):
    #list of each stocks % growth relative to entire SnP500
    relative_growth = []
    #checking the stocks performance history and comparing it to the SnP500, gone up ~5x (last 20yrs)
    for ticker in SnP500:
        stock = yahooquery.Ticker(ticker)
        if num_years is None:
            time_period = "20y"
        else:
            time_period = f"{num_years}y"

        stock_history = stock.history(period=time_period, interval="1mo").reset_index() 

        stock_initial_price = stock_history.iloc[0]["adjclose"]
        stock_latest_price = stock_history.iloc[-2]["adjclose"]
        
        #make sure stock history aligned w snp history
        stock_start_date = stock_history.iloc[0]["date"]
        stock_latest_date = stock_history.iloc[-2]["date"]
        snp_relative_start = snp_history.loc[snp_history.date==stock_start_date].adjclose.values[0]
        snp_latest_price = snp_history.iloc[-2]["adjclose"]

        #have to keep account of compound interest relativity
        #want to compare % of stock increase +/- snp performance relative to how long its been on the market
        #stock A w 2x growth (more than snp) over 10 years is worse than stock B w 2x growth over 5 years
        years = stock_latest_date - stock_start_date
        years = years.days/365.2425

        #annualizing the rate of return
        stock_annualized_ror = (stock_latest_price/stock_initial_price)**(1.0/years)
        #10% return = 1.1x
        snp_annualized_ror = (snp_latest_price/snp_relative_start)**(1.0/years)
        rel_growth = stock_annualized_ror - snp_annualized_ror
        relative_growth.append(rel_growth)

        # print(ticker, rel_growth)
    if num_years is None:
        file_name = "relative_growth.pkl"
    else: 
        file_name = f"relative_growth_{num_years:02d}yrs.pkl"

    with open(file_name, "wb") as pkl:
        pickle.dump(relative_growth, pkl)

