    # with open("dividendsYield.pkl", "rb") as pkl:
    #     yields = np.array(pickle.load(pkl))
    yields = np.array(dividendsYield)

    tkr = yahooquery.Ticker(ticker)

    #take avg of foward and trailing div yield
    try: 
        dy = (tkr.summary_detail[ticker]["dividendYield"] + tkr.summary_detail[ticker]["trailingAnnualDividendYield"]) / 2
    except:
        dy = 0.0

    #create a percentile given a ticker, how does its divdend yields compare to the rest of the snp 500?
    dividend_percentile = (dy > yields).mean()*100
    # print(dividend_percentile)


    if client == "income":
        if dividend_percentile >= 75.0:
            return f"BUY, {ticker} dividend yield > 75% of SnP500 companies (last 20 years), {dividend_percentile:.2f}th percentile to be exact"

        if dividend_percentile < 75.0 and dividend_percentile >= 50.0:
            return f"HOLD, {ticker} dividend yield between 50th and 75th percentile of SnP500 companies (last 20 years), {dividend_percentile:.2f}th percentile to be exact"
        
        if dividend_percentile < 50.0:
            return f"SELL, {ticker} dividend yields less than 50% of SnP500 companies (last 20 years), {dividend_percentile:.2f}th percentile to be exact"


